tokens.value:
svg {
	width: 100%;
	height: 100%;
}

path {
	fill: white;
	opacity: 1;
}

label {
	position: absolute;
	top: 1em;
	left: 1em;
}

.centered {
	font-size: 20vw;
	position: absolute;
	left: 50%;
	top: 50%;
	transform: translate(-50%,-50%);
	font-family: 'Overpass';
	letter-spacing: 0.12em;
	color: #676778;
	font-weight: 400;
}

.centered span {
	will-change: filter;
}
